/***********************************************/
/*       DATA TYPES                            */
/***********************************************/

/*  Operand definition -- used in building     */
/*  format table                               */

typedef enum {
    KVX_REL_ABS,   /* Absolute relocation. */
    KVX_REL_PC,    /* PC relative relocation. */
    KVX_REL_GP,    /* GP relative relocation. */
    KVX_REL_TP,    /* TP relative relocation. */
    KVX_REL_GOT,   /* GOT relative relocation. */
    KVX_REL_BASE,  /* BASE load address relative relocation. */
} kvx_rel_t;

struct kvx_reloc
{
  int bitsize;                /* number of bits            */
  kvx_rel_t relative;          /* Type of relative relocation. */
  int reloc_nb;               /* number of BFD relocs      */
  unsigned int relocs[];      /* List of BFD relocations. */
};

typedef struct kvx_reloc kvx_reloc_t;

struct kvx_bitfield
{
  int size;           /* number of bits            */
  int from_offset;    /* Offset in abstract value. */
  int to_offset;      /* Offset in encoded value.  */
};

typedef struct kvx_bitfield kvx_bitfield_t;

struct kvx_operand
{
  const char *tname;                             /* operand type name     */
  int type;                                      /* type of operand       */
  int width;                                     /* width of the operand. */
  int shift;                                     /* encoded value shift   */
  int bias;                                      /* encoded value bias   */
  int flags;                                     /* Can be SIGNED|CANEXTEND|BITMASK|WRAPPED */
  int reg_nb;                                    /* Number of registers */
  int *regs;                                     /* valid registers for this operand (if no register get null pointer). */
  int reloc_nb;                                  /* Number of relocations */
  kvx_reloc_t **relocs;                           /* List of relocations that can be applied to this operand. */
  int bitfields;                                 /* Number of given bitfields */
  kvx_bitfield_t bfield[];  /* bitfields in most to least significant order. */
};

typedef struct kvx_operand kvxbfield;

/* some flags for kvx_operand                                 */
/* kvxSIGNED    : is this operand treated as signed ?         */
/* kvxCANEXTEND : can this operand have an extension          */
/* kvxBITMASK   : this operand is a bit mask */

/* kvxWRAPPED   : this operand can accept signed and unsigned integer ranges */

#define kvxSIGNED    1
#define kvxCANEXTEND 2
#define kvxBITMASK   4

#define kvxWRAPPED   8

#define kvxOPCODE_FLAG_UNDEF   	0
#define kvxOPCODE_FLAG_IMMX0   	1
#define kvxOPCODE_FLAG_IMMX1   	2
#define kvxOPCODE_FLAG_BCU   	4
#define kvxOPCODE_FLAG_ALU   	8
#define kvxOPCODE_FLAG_LSU   	16
#define kvxOPCODE_FLAG_MAU   	32
#define kvxOPCODE_FLAG_MODE64   	64
#define kvxOPCODE_FLAG_MODE32   	128

/* Opcode definition.                          */

struct kvx_codeword_s {
  unsigned           opcode;                      /* the opcode                     */
  unsigned           mask;                        /* disassembly mask               */
  unsigned           flags;                       /* Target dependent flags.        */
};

typedef struct kvx_codeword_s kvx_codeword_t;

struct kv3opc_s {
  const char               *as_op;                  /* asm name                       */
  kvx_codeword_t codewords[KVXMAXSYLLABLES];   /* 32 bits code words. */
  int                wordcount;                     /* Number of words in codewords[].  */
  unsigned           coding_size;                   /* coding size in case of variable length. */
  int                bundling;                      /* Bundling class */
  int                reservation;                   /* Reservation class */
  kvxbfield *format[KVXMAXOPERANDS + 1];  /* 0 terminated                   */
                                        /* list of operands               */
  const char     *rclass;               /* resource class                 */
  const char     *fmtstring;            /* formating string               */
};
typedef struct kv3opc_s kv3opc_t;

struct kvx_core_info_s
  {
    kv3opc_t *optab;
    const char *names[2];
    const int *resources;
    int supported;
    int elf_cores[2];
  };

